Hoy el Gobierno Nacional estableció el Cupo Laboral Travesti Trans en la administración pública, mediante el Decreto n° 721/20.
El mismo dispone que al menos el 1% de los cargos del Estado Nacional deben ser ocupados por personas trans. 
Asimismo, se brindarán capacitaciones y herramientas para la terminalidad educativa de les aspirantes, la cual no será un obstáculo para el ingreso y la permanencia del empleo; y principalmente, se realizarán capacitaciones a las autoridades del Poder Ejecutivo y al personal del sector público.

Desde la Asamblea No Binarie de Santa Fe, celebramos y reivindicamos con inmensa alegría este avance hacia la igualdad de nuestros #derechos. 

Gracias a la lucha que encarnaron las compañeras, compañeros y compañeres #trans que ya no están, y que soñaron con esta posibilidad, hoy estamos cada vez más cerca de habitar una humanidad libre y sin verguenza. Estamos hilando con urgencia un mundo que debe abrazar nuestras voces, y acunar nuestras vidas. 

Reinvidiquemos la #monstruosidad y prendamos fuego la realidad, porque como dijo #Lohana y #Sacayán, al calabozo no volvemos NUNCA MÁS. 

A seguir trabajando por la #reglamentación y efectiva implementación!

FURIA TRAVA SIEMPRE ✊

