Desde la Asociación de Travestis Transexuales y Transgéneros de Argentina A.T.T.T.A celebramos el decreto del presidente Alberto Fernández que garantiza el cupo laboral del 1% en la administración pública nacional para las personas travestis, transexuales y transgénero. Esta decisión constituye un paso importante para la reparación de nuestra población históricamente excluida. 
.
¡Ahora vamos por todo! Esta decisión también nos anima a seguir impulsando con más fuerza la Ley Integral Trans N° 2786-D-2020. Estamos convencidxs de que solo con un marco legal integral vamos a poder garantizar mejores condiciones de vida para nuestra población, el acceso a todos los derechos humanos. 
.
¡No tenemos tiempo! nuestra expectativa de vida es de 40 años. Necesitamos con urgencia: educación, salud integral, acceso a la vivienda, fuentes de trabajo, derechos para las infancias Trans y para las personas Trans Adultxs mayores, todo esto para poder salir realmente de la pobreza y la exclusión social. 
.
¡No queremos menos que la igualdad! Ahora más que nunca, ¡Vamos por la Ley Integral Trans!
